import React from 'react';
import PropTypes from 'prop-types';
import styled from '@emotion/styled'
import NavBar from './NavBar';
import FooterBar from './FooterBar';
import { Box } from '@mui/material';

let Root = styled.div({
  backgroundColor: 'basis.main',
  height: '100vh',
  overflow: 'hidden',
  width: '100%'
})
let Wrapper = styled.div({
  display: 'flex',
  flex: '1 1 auto',
  overflow: 'hidden',
  paddingTop: 40,
  paddingLeft: 250

})
let ContentContainer = styled.div({
  display: 'flex',
  flex: '1 1 auto',
  overflow: 'hidden',
})
let Content = styled.div({
  flex: '1 1 auto',
  height: '100%',
  overflow: 'auto',
})


const DashboardLayout = ({ children }) => {
  return (
    <Box sx={{
      backgroundColor: 'basis.main',
      height: '100vh',
      overflow: 'hidden',
      width: '100%'
    }}>
    <Root>
      <NavBar/>
      <Wrapper>
        <ContentContainer>
          <Content>
            {children}

          </Content>
        </ContentContainer>

      </Wrapper>
    </Root>
    </Box>

  );
};

DashboardLayout.propTypes = {
  children: PropTypes.node
};

export default DashboardLayout;
